import React from 'react';
import { Cascader } from 'antd';


const options = [
    {
      value: 'zhejiang',
      label: 'Zhejiang',
      children: [
        {
          value: 'hangzhou',
          label: 'Hangzhou',
          children: [
            {
              value: 'xihu',
              label: 'West Lake',
            },
          ],
        },
      ],
    },
    {
      value: 'jiangsu',
      label: 'Jiangsu',
      disabled: true,
      children: [
        {
          value: 'nanjing',
          label: 'Nanjing',
          children: [
            {
              value: 'zhonghuamen',
              label: 'Zhong Hua Men',
            },
          ],
        },
      ],
    },
  ];


  const onChange = (value) => {
    console.log(value);
  };
const NavbarReport = () => {
  return (
    <div style={{background:"white", width:"1120px", height:"70px"}}>
        <h4 style={{padding:"20px"}}>Reports</h4>
        <Cascader options={options} onChange={onChange} placeholder="Please select" />
);

export default App;

    </div>
  )
}

export default NavbarReport
